// SPDX-License-Identifier: MIT
pragma solidity ^0.6.0;

import "@openzeppelin/contracts-ethereum-package/contracts/access/Ownable.sol";
import "@openzeppelin/contracts-ethereum-package/contracts/math/SafeMath.sol";

interface EIP20 {
    function balanceOf(address owner) external view returns (uint256 balance);

    function transfer(address dst, uint256 amount) external returns (bool success);

    function transferFrom(
        address src,
        address dst,
        uint256 amount
    ) external returns (bool success);

    function approve(address spender, uint256 amount) external returns (bool success);
}

interface EIP20NonStandard {
    function balanceOf(address owner) external view returns (uint256 balance);

    function transfer(address dst, uint256 amount) external;

    function transferFrom(
        address src,
        address dst,
        uint256 amount
    ) external;

    function approve(address spender, uint256 amount) external;
}

interface CErc20 {
    function isCToken() external view returns (bool);

    function mint(uint256) external returns (uint256);

    function balanceOf(address owner) external view returns (uint256);

    function balanceOfUnderlying(address owner) external returns (uint256);

    function exchangeRateCurrent() external returns (uint256);

    function exchangeRateStored() external view returns (uint256);

    function redeem(uint256) external returns (uint256);

    function redeemUnderlying(uint256) external returns (uint256);

    function supplyRatePerBlock() external view returns (uint256);

    function underlying() external view returns (address);
}

interface CEther {
    function mint() external payable;

    function balanceOf(address owner) external view returns (uint256);

    function balanceOfUnderlying(address owner) external returns (uint256);

    function exchangeRateCurrent() external returns (uint256);

    function redeem(uint256) external returns (uint256);

    function redeemUnderlying(uint256) external returns (uint256);

    function supplyRatePerBlock() external view returns (uint256);
}

contract MyContract is OwnableUpgradeSafe {
    using SafeMath for uint256;

    /**
     * @notice Event emitted when tokens are minted
     */
    event Mint(address minter, uint256 mintAmount, uint256 mintTokens);

    /**
     * @notice Event emitted when tokens are redeemed
     */
    event Redeem(address redeemer, uint256 redeemAmount, uint256 redeemTokens);

    /**
     * @notice Official record of cToken balances for each account
     */
    mapping(address => mapping(address => uint256)) public accountTokens;

    mapping(address => mapping(address => uint256)) public accountPastEarnings;

    /**
     * @notice Official record of underlying balances for each account
     */
    mapping(address => mapping(address => uint256)) public accountUnderlying;

    uint256 public ownerFeeExp; // * 1e16 (1%);

    function initialize() public initializer {
        OwnableUpgradeSafe.__Ownable_init();
        ownerFeeExp = 10**16;
    }

    function mint(
        uint256 mintAmount,
        EIP20NonStandard token,
        CErc20 cErc20
    ) external returns (uint256) {
        address _cErc20 = address(cErc20);
        token.transferFrom(msg.sender, address(this), mintAmount);
        token.approve(_cErc20, mintAmount);

        uint256 preMintTokenBalance = cErc20.balanceOf(address(this));
        uint256 mintError = cErc20.mint(mintAmount);

        require(mintError == 0, "token minting failed");

        uint256 postMintTokenBalance = cErc20.balanceOf(address(this));
        uint256 mintedTokens = postMintTokenBalance.sub(preMintTokenBalance);
        accountTokens[msg.sender][_cErc20] += mintedTokens;
        accountUnderlying[msg.sender][_cErc20] += mintAmount;

        emit Mint(msg.sender, mintAmount, mintedTokens);

        return mintError;
    }

    function redeemUnderlying(
        uint256 redeemAmount,
        EIP20NonStandard token,
        CErc20 cErc20
    ) external returns (uint256) {
        address _cErc20 = address(cErc20);
        require(redeemAmount > 0, "invalid amount");

        (uint256 deposit, , uint256 balance, uint256 earnings) = balances(cErc20);

        require(balance >= redeemAmount, "insufficient balance");

        uint256 preTokenBalance = cErc20.balanceOf(address(this));
        uint256 redeemError = cErc20.redeemUnderlying(redeemAmount);

        require(redeemError == 0, "underlying redeeming failed");

        uint256 postTokenBalance = cErc20.balanceOf(address(this));
        uint256 redeemedTokens = preTokenBalance.sub(postTokenBalance);

        token.transfer(msg.sender, redeemAmount);

        // First we update token values
        accountTokens[msg.sender][_cErc20] -= redeemedTokens;

        // Then update past earnings
        updateEarnings(redeemAmount, deposit, earnings, _cErc20);

        emit Redeem(msg.sender, redeemAmount, redeemedTokens);

        return redeemError;
    }

    // https://compound.finance/docs#protocol-math
    function balances(CErc20 cErc20)
        public
        returns (
            uint256 underlying,
            uint256 cTokens,
            uint256 totalBalance,
            uint256 currentEarnings
        )
    {
        //EIP20 erc20 = EIP20(cErc20.underlying());
        //uint256 decimals = erc20.decimals();
        //uint256 cTokenDecimals = 8; // all cTokens have 8 decimal places
        //uint256 mantissa = 10**(18 + decimals - cTokenDecimals);
        underlying = accountUnderlying[msg.sender][address(cErc20)];
        cTokens = accountTokens[msg.sender][address(cErc20)];
        totalBalance = cTokens.mul(cErc20.exchangeRateCurrent()).div(10**18);
        if (totalBalance > underlying) {
            currentEarnings = totalBalance.sub(underlying);
        }
    }

    function pastEarnings(address _cToken) public view returns (uint256) {
        return accountPastEarnings[msg.sender][_cToken];
    }

    function supplyRatePerBlock(CErc20 cErc20) external view returns (uint256) {
        return cErc20.supplyRatePerBlock();
    }

    /* ETHEREUM */

    function mintEth(address payable _cEth) external payable returns (bool) {
        CEther cEth = CEther(_cEth);

        uint256 preMintTokenBalance = cEth.balanceOf(address(this));
        cEth.mint{value: msg.value}();
        uint256 postMintTokenBalance = cEth.balanceOf(address(this));

        uint256 mintedTokens = postMintTokenBalance.sub(preMintTokenBalance);

        // First we update token values
        accountTokens[msg.sender][_cEth] += mintedTokens;

        // Then we update underlying values
        accountUnderlying[msg.sender][_cEth] += msg.value;

        emit Mint(msg.sender, msg.value, mintedTokens);

        return true;
    }

    function redeemUnderlyingEth(uint256 redeemAmount, CEther cEth) external returns (uint256) {
        address _cEth = address(cEth);
        require(redeemAmount > 0, "invalid amount");

        (uint256 deposit, , uint256 balance, uint256 earnings) = balancesEth(cEth);

        require(balance >= redeemAmount, "insufficient balance");

        uint256 preTokenBalance = cEth.balanceOf(address(this));
        uint256 redeemError = cEth.redeemUnderlying(redeemAmount);

        require(redeemError == 0, "underlying redeeming failed");

        uint256 postTokenBalance = cEth.balanceOf(address(this));
        uint256 redeemedTokens = preTokenBalance.sub(postTokenBalance);

        msg.sender.transfer(redeemAmount);

        // First we update token values
        accountTokens[msg.sender][_cEth] -= redeemedTokens;

        // Then update past earnings
        updateEarnings(redeemAmount, deposit, earnings, _cEth);

        emit Redeem(msg.sender, redeemAmount, redeemedTokens);

        return redeemError;
    }

    function updateEarnings(
        uint256 redeemAmount,
        uint256 deposit,
        uint256 earnings,
        address cToken
    ) private {
        if (redeemAmount > deposit) {
            accountPastEarnings[msg.sender][cToken] += redeemAmount.sub(deposit);
            accountUnderlying[msg.sender][cToken] -= deposit;
        } else if (redeemAmount > earnings) {
            accountUnderlying[msg.sender][cToken] -= redeemAmount;
        } else {
            accountPastEarnings[msg.sender][cToken] += redeemAmount;
        }
    }

    function balancesEth(CEther cEth)
        public
        returns (
            uint256 underlying,
            uint256 cTokens,
            uint256 totalBalance,
            uint256 currentEarnings
        )
    {
        underlying = accountUnderlying[msg.sender][address(cEth)];
        cTokens = accountTokens[msg.sender][address(cEth)];
        totalBalance = cTokens.mul(cEth.exchangeRateCurrent()).div(10**18);
        if (totalBalance > underlying) {
            currentEarnings = totalBalance.sub(underlying);
        }
    }

    function supplyRatePerBlockEth(CEther cEth) public view returns (uint256) {
        return cEth.supplyRatePerBlock();
    }

    /* ADMIN HELPERS */
    function cErc20Details(CErc20 cErc20) public returns (uint256 tokens, uint256 underlying) {
        tokens = cErc20.balanceOf(address(this));
        underlying = cErc20.balanceOfUnderlying(address(this));
    }

    function cEthDetails(CEther cEth) public returns (uint256 tokens, uint256 underlying) {
        tokens = cEth.balanceOf(address(this));
        underlying = cEth.balanceOfUnderlying(address(this));
    }

    // This is needed to receive ETH when redeeming.
    receive() external payable {}
}
